import React from "react";

function Detailscard() {
  return (
    <>
      <div class="container text-center">
        <div class="row row-cols-4">
          <div class="col">Column</div>
          <div class="col">Column</div>
          <div class="col">Column</div>
          <div class="col">Column</div>
        </div>
      </div>
    </>
  );
}

export default Detailscard;
